        />
      </div> */}

      <div className="d-flex justify-content-center">
        <button type="button" className="btn custom-button" style={{margin: "20px 30px"}}>
          GET BOT
        </button>

          <Link to={`configuration/${props.id}`}>
            <button type="button" className="btn custom-button" style={{margin: "20px 30px"}}>
              MODIFY
            </button>
          </Link>

      </div>
    </div>
  );
}

export default DetailedPage;
